import React from 'react'

export default function SingleRoom({room}) {
    console.log(room)
    return (
        <div className="single-room">
            <div className="single-room-images">
                {room.images.map(images =>{
                   return <img src={images} alt="" key={indexOf({images})}></img>
                })}
            </div>
        </div>
    )
}
